function InputText ({id, placeholder, value, disabled, width, onChange}){
  let readOnly;
  disabled === true ? readOnly = disabled : readOnly = null

  const style = {
    width
  }

  return (
      <input id={id} placeholder={placeholder} value={value} disabled={disabled} style={style} onChange={onChange} />
  )
}

export default InputText;
